from collections import deque

# Wall bit masks
TOP = 8     # bit 0
RIGHT = 4   # bit 1
BOTTOM = 2  # bit 2
LEFT = 1    # bit 3

ROWS = 125
COLS = 125

# Direction helpers: (dx, dy, wall_in_current, wall_in_next)
DIRECTIONS = [
    (0, -1, TOP, BOTTOM),   # up
    (1, 0, RIGHT, LEFT),    # right
    (0, 1, BOTTOM, TOP),    # down
    (-1, 0, LEFT, RIGHT)    # left
]

def idx(x, y, cols):
    # Convert (x,y) to 1D index
    return y * cols + x


def solve_maze(maze, rows, cols, start, goal):
    start_idx = idx(*start, cols)
    goal_idx = idx(*goal, cols)

    queue = deque([start_idx])
    visited = {start_idx: None} 

    while queue:
        cur = queue.popleft()
        x, y = cur % cols, cur // cols

        if cur == goal_idx:
            break

        for dx, dy, wall_curr, wall_next in DIRECTIONS:
            nx, ny = x + dx, y + dy
            if 0 <= nx < cols and 0 <= ny < rows:
                n_idx = idx(nx, ny, cols)
                # check walls
                if (maze[cur] & wall_curr) == 0 and (maze[n_idx] & wall_next) == 0:
                    if n_idx not in visited:
                        visited[n_idx] = cur
                        queue.append(n_idx)

    # reconstruct path
    if goal_idx not in visited:
        return None

    path = []
    cur = goal_idx
    while cur is not None:
        path.append((cur % cols, cur // cols))
        cur = visited[cur]

    path.reverse()
    return path

def pos_to_char(pos, charlist):
    return charlist[idx(*pos, COLS)]

